import React from 'react'
import Card from '@material-ui/core/Card'
import CardActions from '@material-ui/core/CardActions'
import CardContent from '@material-ui/core/CardContent'
import CardMedia from '@material-ui/core/CardMedia'
import Button from '@material-ui/core/Button'
import Typography from '@material-ui/core/Typography'

const CardBlock = (props) => {
    console.log(props)
    return(
        <div>
            { props.area ? (
                <Card >
                    <CardMedia style={{height: 0, paddingTop: '56.25%'}}
                    //image={props.course.fields.courseImage.fields.file.url}
                    title={props.area.ContentAreaName}
                    />
                    <CardContent>
                    <Typography gutterBottom variant="headline" component="h2">
                        {props.area.ContentAreaName}
                    </Typography>
                    <Typography component="p">
                        {props.area.Description}
                    </Typography>
                    </CardContent>
                    <CardActions>
                    <Button size="small" color="primary" href={props.area.ContentAreaName} target="_blank">
                        Go To Area
                    </Button>
                    </CardActions>
                </Card>
            ) : null}
        </div>
    )
}
export default CardBlock
